import React, { Fragment } from 'react';
import MaterialTable from 'material-table';
import RealTimerReport from '../../../core/report';

export default class LockerRealTimeReport extends React.Component {

    columns = [
        { title: 'Tòa nhà', field: '' },
        { title: 'Tầng', field: 'eCode' },
        { title: 'Tủ', field: 'email' },
        { title: 'Hành động', field: 'name' },
        { title: 'Trạng thái của tủ', field: 'eCode' },
        { title: 'Người sử dụng cuối cùng', field: 'email' },
        { title: 'ID nhân sự', field: 'name' },
        { title: 'Thời điểm thao tác lần cuối', field: 'eCode' },
    ] 

    options =  
    {
        search: false,
        pageSize: 20,
        pageSizeOptions: [20],
    }
    
    constructor(props) {
        super(props);
        this.state = {

        };
    }

    
    getDataFromServer = (query) => {
        return new Promise((resolve, reject) => {
            RealTimerReport.getRealTimeReport()
                .then(value => {
                   console.log(value)
                })
        })
    }

    componentDidMount() {
    }

    render() {
        return(
            <div>
                <MaterialTable
                title = 'Theo dõi sự kiện sử dụng tủ thời gian thực'
                columns = {this.columns}
                options = {this.options}
                data = {this.getDataFromServer}
                />
            </div>
        )
    }
}
